import {StyleSheet} from "react-native"

const styles = StyleSheet.create({
    boxTitle: {
        alignItems:"center",
        justifyContent: "center",
        padding:10,
    },
    textTitle: {
        color: "#FF0043",
        fontSize:20,
        fontWeight:"bold",
    }
});

export default styles
